import "./ComponentStyles.css";



const SearchBar = ({ }) => {
  return (
    <div class="search-bar-container" style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '100vh',
      }}>
      <p>Search here:</p>
      <br />
      <input class="search-bar" type="textbox"></input>
    </div>
  )
}

export default SearchBar;
